import React, { useState } from "react";
import Modal from "react-bootstrap/Modal";
import Style from "./modal.module.scss";

export default function CardModal({ show, setShow, veiculo }) {
  useState(false);
  return (
    <>
      <Modal
        show={show}
        onHide={() => setShow(false)}
        dialogClassName="modal-90w"
        aria-labelledby="example-custom-modal-styling-title"
      >
        <Modal.Header closeButton>
          <Modal.Title id="example-custom-modal-styling-title">
            {veiculo.nome}
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <img
            className={Style.img}
            src={veiculo.imagem}
            alt="Imagem do veículo"
          />
          <div>
            <label>
              <strong>Marca:</strong> {veiculo.marca}
            </label>
            <label>
              <strong>Ano:</strong> {veiculo.ano}
            </label>
            <label>
              <strong>Modelo:</strong> {veiculo.potencia}
            </label>
            <label>
              <strong>Cor:</strong> {veiculo.cor}
            </label>
            <label>
              <strong>Cabine:</strong> {veiculo.cabine}
            </label>
            <label>
              <strong>Combustível:</strong> {veiculo.combustivel}
            </label>
            <label>
              <strong>Suspensao:</strong> {veiculo.tipo_suspensao}
            </label>
            <label>
              <strong>KM:</strong> {veiculo.km}
            </label>
          </div>
        </Modal.Body>
      </Modal>
    </>
  );
}
